Who are You (Ch4)

Arts Documentary hosted by Grayson Perry, published by Channel 4 in 2014 - English narration


Information
------------------------------

Grayson Perry turns his attention to identity as he creates portraits - from tapestries to sculptures and pots - of diverse individuals who are all trying to define who they are.
Part 1.
Grayson Perry creates diverse portraits, starting with ex-MP Chris Huhne, Rylan Clark from X-Factor, a Muslim convert and a young transgender man.
Part 2.
In this episode he meets the Jesus Army, a white gay couple with a mixed-race son and a couple living with Alzheimer's.
Part 3.
Grayson looks at 21st century tribes. We all like to proclaim our individuality but the urge to be part of a group is as strong as ever.

